,38.6,1426}},lore="Located in Dun Morogh, the technological wonder known as Gnomeregan has been the gnomes' capital city for generations. Recently, a hostile race of mutant troggs infested several regions of Dun Morogh - including the great gnome city. In a desperate attempt to destroy the invading troggs, High Tinker Mekkatorque ordered the emergency venting of the city's radioactive waste tanks. Several gnomes sought shelter from the airborne pollutants as they waited for the troggs to die or flee. Unfortunately, though the troggs became irradiated from the toxic assault - their siege continued, unabated. Those gnomes who were not killed by noxious seepage were forced to flee, seeking refuge in the nearby dwarven city of Ironforge. There, High Tinker Mekkatorque set out to enlist brave souls to help his people reclaim their beloved city.\n\nIt is rumored that Mekkatorque's once-trusted advisor, Mekgineer Thermaplug, betrayed his people by allowing the invasion to happen. Now, his sanity shattered, Thermaplug remains in Gnomeregan - furthering his dark schemes and acting as the city's new techno-overlord.",lvl=19,mapID=226,maps={227,228,229},savedInstanceID=90,["zone-text-areaID"]=133,g={h(-63,{s(159404,9510,{crs={6228,6235,7800,7079},f=6,lvl=27,q=3}),i(5108,{crs={6212},f=5,lvl=27,q=1}),s(159399,9490,{crs={6232,6207,6206,6212,6220,6329,7603,6223,6222,6234,6233,6226,6227,6225,6230},f=26,lvl=24,q=3}),i(9308,{q=1}),i(9326,{b=1,crs={6212},lvl=28,q=1}),s(159398,9489,{b=1,crs={6232,6212,6220,7603,6234,6233,6227,6230},f=27,lvl=26,q=2}),s(159396,9487,{crs={6232,6207,6206,6211,6212,6391,6220,6329,7603,6223,6234,6233,6230},f=31,lvl=24,q=3}),s(159400,9491,{f=4,lvl=27,q=3}),s(159402,9508,{crs={6232,6212,6223,6234,6233,6230},f=4,learnedAt=75,lvl=26,q=3,requireSkill=202}),s(159397,9488,{crs={6232,6207,6206,6211,6212,6329,7603,6223,6234,6233,6226,6227,6225,6230},f=23,lvl=23,q=3}),s(159403,9509,{crs={6232,6207,6206,6212,6391,6220,6329,6218,7603,6223,6234,6233,6227,6230},f=5,lvl=25